const initialCompanyFormState = {
  companyname: "",
  email: "",
  password: "",
  location: ""
};

const reducer = (state = initialCompanyFormState, action) => {
  if (action.type === "COMPANYNAMECHANGE") {
    console.log(state);
    return {};
  }
  return state;
};

export default reducer;
